tables.table_schema:
CREATE TABLE iris_scans (
    id UUID PRIMARY KEY,
    scan_time TIMESTAMP,
    scan_data BYTEA
);

CREATE TABLE users (
    user_id UUID PRIMARY KEY,
    username TEXT UNIQUE,
    iris_scan_id UUID,
    FOREIGN KEY (iris_scan_id) REFERENCES iris_scans(id)
);

CREATE TABLE IrisScanInformation (
    iris_id UUID PRIMARY KEY,
    scan_timestamp TIMESTAMP,
    scan_result VARCHAR
);

CREATE TABLE UserData (
    user_id UUID PRIMARY KEY,
    username VARCHAR,
    email VARCHAR
);

CREATE TABLE iris_scans (
    id SERIAL PRIMARY KEY,
    user_id INT,
    iris_data BYTEA,
    scan_date TIMESTAMP
);

CREATE TABLE users (
    user_id SERIAL PRIMARY KEY,
    name VARCHAR(50),
    email VARCHAR(100)
);

CREATE TABLE permissions (
    user_id INT,
    access_level INT
);

CREATE TABLE history (
    id SERIAL PRIMARY KEY,
    user_id INT,
    action VARCHAR(50),
    action_date TIMESTAMP
);

CREATE TABLE iris_scan_information (
   id INT PRIMARY KEY,
   person_id INT,
   iris_data BYTEA,
   scan_timestamp TIMESTAMP
);

CREATE TABLE access_logs (
   log_id INT PRIMARY KEY,
   person_id INT,
   access_time TIMESTAMP,
   location VARCHAR(100)
);

CREATE TABLE access_permissions (
   permission_id INT PRIMARY KEY,
   person_id INT,
   access_level VARCHAR(20)
);

CREATE TABLE system_users (
   user_id INT PRIMARY KEY,
   username VARCHAR(50),
   password VARCHAR(100),
   person_id INT
);
